# Dump of PROCEDURE remove_duplicate_material_groups
# ------------------------------------------------------------

/*!50003 DROP PROCEDURE IF EXISTS `remove_duplicate_material_groups` */;;
/*!50003 SET SESSION SQL_MODE="ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION"*/;;
/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`%`*/ /*!50003 PROCEDURE `remove_duplicate_material_groups`()
BEGIN
    -- 创建临时表存储 duplicate_groups 的结果
    CREATE TEMPORARY TABLE temp_duplicate_groups AS
    WITH grouped_materials AS (
        -- 生成唯一的材料组合标识
        SELECT
            experiment_material_group_id,
            COUNT(*) AS material_count,
            GROUP_CONCAT(material_name, ':', percentage, ':', material_group_name ORDER BY material_name, percentage, material_group_name SEPARATOR '|') AS material_signature
        FROM materials
        GROUP BY experiment_material_group_id
    ),
    duplicate_groups AS (
        -- 查找所有相同 material_signature 的 group，并选择最小的 ID 作为 original_group
        SELECT g1.experiment_material_group_id AS duplicate_group,
               MIN(g2.experiment_material_group_id) AS original_group
        FROM grouped_materials g1
        JOIN grouped_materials g2 
            ON g1.material_signature = g2.material_signature
        GROUP BY g1.experiment_material_group_id
    )
    SELECT * FROM duplicate_groups;
    
    -- 更新 recipe_material_groups 表
    UPDATE recipe_material_groups rmg
    JOIN temp_duplicate_groups dg
        ON rmg.experiment_material_group_id = dg.duplicate_group
    SET rmg.experiment_material_group_id = dg.original_group;

    -- 删除 materials 表中 experiment_material_group_id 为 duplicate_group 的数据
    DELETE FROM materials
    WHERE experiment_material_group_id IN (
        SELECT duplicate_group
        FROM temp_duplicate_groups
        WHERE duplicate_group <> original_group
    );

    -- 删除临时表
    DROP TEMPORARY TABLE temp_duplicate_groups;
END */;;

