# Dump of PROCEDURE synchronous_recipe
# ------------------------------------------------------------

/*!50003 DROP PROCEDURE IF EXISTS `synchronous_recipe` */;;
/*!50003 SET SESSION SQL_MODE="ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION"*/;;
/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`%`*/ /*!50003 PROCEDURE `synchronous_recipe`()
BEGIN
    DECLARE recipe_count INT;

    -- 计算当前 recipes 表中的记录数量
    SELECT COUNT(*) INTO recipe_count FROM recipes;

    -- 创建临时表，存储唯一的实验步骤配方签名
    CREATE TEMPORARY TABLE temp_unique_experiment_steps AS
    SELECT esm.experiment_step_id,
           MD5(GROUP_CONCAT(
               CONCAT_WS(',', 
                   m.material_group_name, 
                   esm.proportion, 
                   m.material_name, 
                   m.percentage
               ) ORDER BY m.material_group_name, m.material_name
           )) AS recipe_signature
    FROM experiment_step_material esm
    JOIN materials m ON esm.experiment_material_group_id = m.experiment_material_group_id
    GROUP BY esm.experiment_step_id;

    -- 过滤出新配方的签名
    CREATE TEMPORARY TABLE temp_new_recipe_signatures AS
    SELECT DISTINCT recipe_signature
    FROM temp_unique_experiment_steps
    WHERE recipe_signature NOT IN (SELECT recipe_signature FROM recipes);

    -- 插入新配方到 recipes 表（增量插入）
    SELECT 
        UUID() AS id,
        CONCAT('配方', recipe_count + ROW_NUMBER() OVER (ORDER BY (SELECT NULL))) AS recipe_name,
        recipe_signature,
        recipe_count + ROW_NUMBER() OVER (ORDER BY (SELECT NULL))
    FROM temp_new_recipe_signatures;

    -- 关联新配方ID到实验步骤
    CREATE TEMPORARY TABLE temp_recipe_mapping AS
    SELECT 
        e.experiment_step_id,
        r.id AS recipe_id
    FROM temp_unique_experiment_steps e
    JOIN recipes r ON e.recipe_signature = r.recipe_signature;

    -- 插入配方与材料组关系表（增量插入，避免重复）
    SELECT DISTINCT
        m.recipe_id,
        esm.experiment_material_group_id,
        esm.proportion
    FROM experiment_step_material esm
    JOIN temp_recipe_mapping m ON esm.experiment_step_id = m.experiment_step_id;

    -- 删除临时表
    DROP TEMPORARY TABLE IF EXISTS temp_unique_experiment_steps;
    DROP TEMPORARY TABLE IF EXISTS temp_new_recipe_signatures;
    DROP TEMPORARY TABLE IF EXISTS temp_recipe_mapping;

END */;;

